const t=JSON.parse('{"key":"v-2f0cd186","path":"/dev-tools/git/git-branch-manage.html","title":"Git 分支管理","lang":"zh-CN","frontmatter":{"order":5,"description":"Git 分支管理 在 Git 中，分支是指向提交对象（commits）的可变指针。它们是一系列提交的引用，其中的每个提交都包含了一组文件的状态以及指向其父提交的指针。主要的分支通常是 master 或 main，其他分支可以基于主分支或其他分支创建。 几乎每一种版本控制系统都以某种形式支持分支，一个分支代表一条独立的开发线。使用分支意味着你可以从开发主线上分离开来，然后在不影响主线的同时继续工作。 Git 分支实际上是指向更改快照的指针。 创建分支","head":[["meta",{"property":"og:url","content":"https://www.codermast.com/dev-tools/git/git-branch-manage.html"}],["meta",{"property":"og:site_name","content":"CoderMast编程桅杆"}],["meta",{"property":"og:title","content":"Git 分支管理"}],["meta",{"property":"og:description","content":"Git 分支管理 在 Git 中，分支是指向提交对象（commits）的可变指针。它们是一系列提交的引用，其中的每个提交都包含了一组文件的状态以及指向其父提交的指针。主要的分支通常是 master 或 main，其他分支可以基于主分支或其他分支创建。 几乎每一种版本控制系统都以某种形式支持分支，一个分支代表一条独立的开发线。使用分支意味着你可以从开发主线上分离开来，然后在不影响主线的同时继续工作。 Git 分支实际上是指向更改快照的指针。 创建分支"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"article:author","content":"友人CoderMast"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"Git 分支管理\\",\\"image\\":[\\"\\"],\\"dateModified\\":null,\\"author\\":[{\\"@type\\":\\"Person\\",\\"name\\":\\"友人CoderMast\\",\\"url\\":\\"https://www.codermast.com\\",\\"email\\":\\"codermast@163.com\\"}]}"]]},"headers":[{"level":2,"title":"创建分支","slug":"创建分支","link":"#创建分支","children":[]},{"level":2,"title":"切换分支","slug":"切换分支","link":"#切换分支","children":[]},{"level":2,"title":"删除分支","slug":"删除分支","link":"#删除分支","children":[]},{"level":2,"title":"合并分支","slug":"合并分支","link":"#合并分支","children":[]},{"level":2,"title":"查看分支列表","slug":"查看分支列表","link":"#查看分支列表","children":[]},{"level":2,"title":"","slug":"","link":"#","children":[]}],"git":{"createdTime":null,"updatedTime":null,"contributors":[]},"readingTime":{"minutes":1.74,"words":522},"filePathRelative":"dev-tools/git/git-branch-manage.md","excerpt":"<h1> Git 分支管理</h1>\\n<figure><figcaption></figcaption></figure>\\n<p>在 Git 中，分支是指向提交对象（commits）的可变指针。它们是一系列提交的引用，其中的每个提交都包含了一组文件的状态以及指向其父提交的指针。主要的分支通常是 master 或 main，其他分支可以基于主分支或其他分支创建。</p>\\n<p>几乎每一种版本控制系统都以某种形式支持分支，一个分支代表一条独立的开发线。使用分支意味着你可以从开发主线上分离开来，然后在不影响主线的同时继续工作。</p>\\n<p>Git 分支实际上是指向更改快照的指针。</p>\\n<h2> 创建分支</h2>","autoDesc":true}');export{t as data};
